// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SocialNetwork {
    struct Post {
        uint256 id;
        address author;
        string content;
        string imageURL;
        uint256 timestamp;
    }

    struct Profile {
        string username;
        string status;
        string image;
        uint256 followersCount;
        uint256 followingCount;
        address[] followers;
        address[] following;
    }

    mapping(address => Profile) public profiles;
    mapping(address => Post[]) public userPosts;
    mapping(address => mapping(address => bool)) public isFollowing;
    mapping(address => string) public userMessages;
    mapping(address => uint256) public activityStatus;

    uint256 public postCount;

    event NewPost(
        uint256 postId,
        address indexed author,
        string content,
        string imageURL,
        uint256 timestamp
    );
    event NewMessage(address indexed from, address indexed to, string message);
    event Follow(address indexed follower, address indexed followee);
    event ActivityStatusChanged(address indexed user, uint256 newStatus);

    modifier onlyExistingProfile() {
        require(
            bytes(profiles[msg.sender].username).length > 0,
            "Profile does not exist"
        );
        _;
    }

    function createProfile(
        string memory _username,
        string memory _status
    ) public {
        require(
            bytes(profiles[msg.sender].username).length == 0,
            "Profile already exists"
        );
        profiles[msg.sender].username = _username;
        profiles[msg.sender].status = _status;
    }

    function updateStatus(string memory _status) public onlyExistingProfile {
        profiles[msg.sender].status = _status;
        emit ActivityStatusChanged(msg.sender, block.timestamp);
    }

    function uploadPost(
        string memory _content,
        string memory _imageURL
    ) public onlyExistingProfile {
        postCount++;
        Post memory newPost = Post(
            postCount,
            msg.sender,
            _content,
            _imageURL,
            block.timestamp
        );
        userPosts[msg.sender].push(newPost);
        emit NewPost(
            postCount,
            msg.sender,
            _content,
            _imageURL,
            block.timestamp
        );
    }

    function sendMessage(
        address _to,
        string memory _message
    ) public onlyExistingProfile {
        require(
            bytes(profiles[_to].username).length > 0,
            "Recipient profile does not exist"
        );
        userMessages[_to] = _message;
        emit NewMessage(msg.sender, _to, _message);
    }

    function follow(address _profile) public onlyExistingProfile {
        require(msg.sender != _profile, "Cannot follow yourself");
        require(!isFollowing[msg.sender][_profile], "Already following");

        profiles[_profile].followers.push(msg.sender);
        profiles[_profile].followersCount++;
        profiles[msg.sender].following.push(_profile);
        profiles[msg.sender].followingCount++;
        isFollowing[msg.sender][_profile] = true;

        emit Follow(msg.sender, _profile);
    }

    function getPosts(address _profile) public view returns (Post[] memory) {
        return userPosts[_profile];
    }

    function getFollowers(
        address _profile
    ) public view returns (address[] memory) {
        return profiles[_profile].followers;
    }

    function getFollowing(
        address _profile
    ) public view returns (address[] memory) {
        return profiles[_profile].following;
    }

    function getStatus(address _profile) public view returns (string memory) {
        return profiles[_profile].status;
    }

    function getMessages() public view returns (string memory) {
        return userMessages[msg.sender];
    }

    function getActivityStatus() public view returns (uint256) {
        return activityStatus[msg.sender];
    }

    function setActivityStatus(uint256 _status) public onlyExistingProfile {
        activityStatus[msg.sender] = _status;
        emit ActivityStatusChanged(msg.sender, _status);
    }
}

